import axios from 'axios'

const BASE_URL = "https://api.spoonacular.com/recipes"

class Products {
    static getRandomProduct = async ()=> {
        const res = await axios.get(`${BASE_URL}/random`)
        console.log(res)
    }
}

export default Products
